import React from "react";

export default function Main() {
  return (
    <>
      <div
        className="bg-dark"
        style={{
          height: "80vh",
        }}
      >
        <p className="h1 text-white">
          An open source initiative for God and Light
        </p>
      </div>
    </>
  );
}
